def run(value_list):
    """
    Calculates the percentage change in the amount for Appliances in 2019 from 2018.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the percentage change.
    """
    appliances_2019 = next(
        (item for item in value_list if item['category'] == 'Appliances' and item['header1'] == 'Communications Solutions:' and item['header5'] == 'Communications Solutions:' and item['header3'] == '2019'),
        None
    )
    appliances_2018 = next(
        (item for item in value_list if item['category'] == 'Appliances' and item['header1'] == 'Communications Solutions:' and item['header5'] == 'Communications Solutions:' and item['header3'] == '2018'),
        None
    )

    if appliances_2019['number_value'] is None or appliances_2018['number_value'] is None:
        return (0.00, "")

    change = ((appliances_2019['number_value'] - appliances_2018['number_value']) / appliances_2018['number_value']) * 100
    return (round(change, 2), "percent")

