def run(value_list):
    """
    Calculates the average total current tax expense for 2018 and 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average total current tax expense.
    """

    year_2019_total = 0
    year_2018_total = 0

    for item in value_list:
        if item['header3'] == '2019':
            year_2019_total += item['number_value']
        elif item['header3'] == '2018':
            year_2018_total += item['number_value']

    if year_2019_total == 0 and year_2018_total == 0:
        return (0.00, "")

    average = (year_2019_total + year_2018_total) / 2

    if average == 0.00:
        return (0.00, "")

    if average < 1000000:
        scale = "thousand"
    elif average < 100000000:
        scale = "million"
    elif average < 100000000000:
        scale = "billion"
    else:
        scale = ""

    return (round(average, 2), scale)

