    Calculates the increase/decrease in the Adjusted EBITDA margin from 2018 to 2019.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale).
    """

    # Extract data for 2018 and 2019
    margin_2018 = None
    margin_2019 = None

    for item in value_list:
        if item['category'] == 'Adjusted EBITA margin' and item['header1'] == '2018':
            margin_2018 = item['number_value']
        elif item['category'] == 'Adjusted EBITA margin' and item['header1'] == '2019':
            margin_2019 = item['number_value']

    if margin_2018 is not None and margin_2019 is not None:
        increase_decrease = margin_2019 - margin_2018
        return (round(increase_decrease, 2), 'million')
    else:
        return (None, '')

def run(value_list):
    """
    Calculates the average interest income for 2018 and 2019 from the provided financial report.

    Args:
        value_list: A list of dictionaries containing financial data.

    Returns:
        A tuple (number, scale) representing the average interest income for 2018 and 2019.
    """
    interest_income_2018 = 0
    interest_income_2019 = 0

    for item in value_list:
        if item['category'] == 'Interest income':
            if item['header3'] == '2018':
                interest_income_2018 = item['number_value']
            elif item['header3'] == '2019':
                interest_income_2019 = item['number_value']

    if interest_income_2018 == 0 or interest_income_2019 == 0:
        return (0.00, "")

    average_income = (interest_income_2018 + interest_income_2019) / 2
    return (round(average_income, 2), "thousand")

