def run(value_list):
    data = {}
    for item in value_list:
        category = item['category']
        year = item['header1']
        revenue = item['number_value']
        if category != '' and year != '2019':
            if category not in data:
                data[category] = {}
            if year not in data[category]:
                data[category][year] = 0
            data[category][year] = revenue

    total_revenue_2019 = data.get('', {'2019': 0})['2019']

    taiwan_revenue_2019 = data.get('Taiwan', {}).get('2019', 0)
    japan_revenue_2019 = data.get('Japan', {}).get('2019', 0)

    if total_revenue_2019 == 0:
        return (0.00, '')

    percentage = (taiwan_revenue_2019 + japan_revenue_2019) / total_revenue_2019 * 100

    return (round(percentage, 2), 'percent')

