    application_software_2018 = 0
    process_technologies_2018 = 0
    for item in data_2018:
        if item['header1'] == 'Application Software':
            application_software_2018 += item['number_value']
        if item['header1'] == 'Process Technologies':
            process_technologies_2018 += item['number_value']

    total_balance_2018 = total_balance_2018 + process_technologies_2018

    proportion = (total_balance_2018 / total_balance_2018) * 100

