    total_notes_payable = 0
    total_capital_lease_obligations = 0

    for item in value_list:
        if item['category'] == 'Notes payable':
            if item['header1'] == 'Total':
                total_notes_payable = item['number_value']
            elif item['header1'] == 'Less than 1 Year':
                total_notes_payable = item['number_value']
        elif item['category'] == 'Capital lease obligations':
            if item['header1'] == 'Total':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == 'Less than 1 Year':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == '1-3 Years':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == '3-5 Years':
                total_capital_lease_obligations = item['number_value']
            elif item['header1'] == 'After 5 Years':
                total_capital_lease_obligations = item['number_value']

    if total_capital_lease_obligations == 0:
        return (0.00, "")

    ratio = (total_notes_payable / total_capital_lease_obligations) * 100
    return (round(ratio, 2), "percent")

